// RandomUserAgent : 随机返回一个浏览器的用户标识
func RandomUserAgent() http.Header {
	rand.Seed(time.Now().UnixNano())
	userAgent := userAgentList[rand.Intn(len(userAgentList))]

	return map[string][]string{
		"User-Agent": {userAgent},
	}
}
